import React from 'react'
import CategoryItem from './CategoryItem'

const CategoriesList = ({categories}) => {
  return (
    <div>
        <h1>Categories:</h1>
        {categories.map(category =>{
            {console.log(category)}
            <CategoryItem
                category={category}
            />
        })}
    </div>
  )
}

export default CategoriesList
